import React from "react";
import "../App.css";
function Products()
{
    return(
        <div>
<h1>Products </h1>


<table class="table1">
    <tr>
        <th>
            Item Id
        </th>
        <th>
            Name
        </th>
        <th>
            Category
        </th>
        <th>
            Price
        </th>
        <th>
           Stock Quantity
        </th>
    </tr>
</table>
        </div>
    )
}

export default Products;




